import React, { useContext, useEffect, useState } from "react";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import Dropdown from "react-bootstrap/Dropdown";
import Tables from "../../components/tables/Tables";
import Spiner from "../../components/spinner/Spiner";
import { useNavigate } from "react-router-dom";

import "./home.css";
import { addData } from "../../components/context/ContextProvider";

const Home = () => {
  const [showspin, setShowSpin] = useState(true);

  const { useradd, setUseradd } = useContext(addData);

  const navigate = useNavigate();

  const adduser = () => {
    navigate("/select-staff-type");
  };

  useEffect(() => {
    setTimeout(() => {
      setShowSpin(false);
    }, 1200);
  }, []);

  return (
    <>
      <div className="container">
        <div className="main_div">
          {/* search add btn */}
          <div className="search_add mt-4 d-flex justify-content-between">
            <div className="search col-lg-4">
              <Form className="d-flex">
                <Form.Control
                  type="search"
                  placeholder="Search"
                  className="me-2"
                  aria-label="Search"
                />
                <Button variant="success" className="search_btn">
                  <i class="fa-solid fa-magnifying-glass"></i>
                </Button>
              </Form>
            </div>
            <div className="add_btn">
              <Button variant="primary" onClick={adduser}>
                <i class="fa-solid fa-plus"></i>&nbsp; Add Staff
              </Button>
            </div>
          </div>
          <div className="filter_div mt-5 d-flex justify-content-between flex-wrap">
            <div className="export_csv">
              <Button className="export_btn">Export to CSV</Button>
            </div>

            <div className="filter_gender">
              <div className="filter">
                <p>Filter by gender</p>
                <div className="gender d-flex justify-content-between">
                  <Form.Check
                    type={"radio"}
                    label={`All`}
                    name="gender"
                    value={"All"}
                    className="radio-spacing"
                    /*onChange={(e) => setGender(e.target.value)}*/
                    defaultChecked
                  />
                  <Form.Check
                    type={"radio"}
                    label={`Male`}
                    name="gender"
                    value={"Male"}
                    className="radio-spacing"
                    /*onChange={(e) => setGender(e.target.value)}*/
                  />
                  <Form.Check
                    type={"radio"}
                    label={`Female`}
                    name="gender"
                    value={"Female"}
                    /*onChange={(e) => setGender(e.target.value)}*/
                  />
                </div>
              </div>
            </div>

            <div className="filter_newold">
              <p>Filter by date</p>
              <Dropdown className="text-center">
                <Dropdown.Toggle className="dropdown_btn" id="dropdown-basic">
                  <i class="fa-solid fa-calendar-week"></i>
                </Dropdown.Toggle>
                <Dropdown.Menu>
                  <Dropdown.Item /*onClick={() => setSort("new")}*/>
                    Newest
                  </Dropdown.Item>
                  <Dropdown.Item /*onClick={() => setSort("old")}*/>
                    Oldest
                  </Dropdown.Item>
                </Dropdown.Menu>
              </Dropdown>
            </div>

            <div className="filter_leave_type">
              <div className="leave_type">
                <p>Filter by leave type</p>
                <div className="leave_type_radio d-flex justify-content-between flex-wrap">
                  <Form.Check
                    type={"radio"}
                    label={`All`}
                    name="leave_type"
                    value={"All"}
                    className="radio-spacing"
                    /*onChange={(e) => setLeaveType(e.target.value)}*/
                    defaultChecked
                  />
                  <Form.Check
                    type={"radio"}
                    label={`Casual`}
                    name="leave_type"
                    value={"Casual"}
                    className="radio-spacing"
                    /*onChange={(e) => setLeaveType(e.target.value)}*/
                  />
                  <Form.Check
                    type={"radio"}
                    label={`Medical`}
                    name="leave_type"
                    value={"Medical"}
                    /*onChange={(e) => setLeaveType(e.target.value)}*/
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
        {showspin ? <Spiner /> : <Tables />}
      </div>
    </>
  );
};

export default Home;
